INSERT INTO Kokteli (K_PK, Ime, Opis, Upute, Slika) VALUES (4, 'Mojito', 'Mojito se pojavio na Kubi izmedu 1910. i 1920. Smatra se da je lokal "La Bodeguita del Medio" u Havani mjesto gdje je 1946. nastao izvorni recept. Ime koktela je kombinacija rijeci vlažan (mojadito) i imena kulinarskog umaka (mojo), što odgovara karakteru ovog tropskog i egzoticnog pica.', '1.	Dodajte 8 – 10 listova mente u ohladenu cašu
