INSERT INTO Kokteli (K_PK, Ime, Opis, Upute, Slika) VALUES (5, '7&7', 'Ovaj koktel je slican Cuba Libreu i može se odnositi na svako pice koje sadrži viski pomiješan sa bezalkoholnim picem od limuna.', '1.	Napunite cašu ledom
