INSERT INTO Kokteli (K_PK, Ime, Opis, Upute, Slika) VALUES (6, 'Irska kava', 'Prema jednoj legendi, originallni recept je izmislio Joseph Sheridan 1940. kada je skupina putnika stigla u irsku zracnu luku. Sheridan ih je pokušao zagrijati ih dodavši viski u kavu. Sada je to službeni koktel Medunarodne zajednice barmena.', '1.	Natocite vrucu kavu u šalicu
