INSERT INTO Kokteli (K_PK, Ime, Opis, Upute, Slika) VALUES (7, 'Bijeli Rus', 'Vrsta Crnog Rusa s dodatkom šlaga. Naziva se „Rus“ zbog toga što je votka glavni sastojak.', '1.	Stavite nekoliko kocki leda u cašu
