INSERT INTO Kokteli (K_PK, Ime, Opis, Upute, Slika) VALUES (8, 'Crni Rus', 'Crni Rus je prvi napravio 1949. blegijski barmen Gustave Tops i danas je službeni koktel Medunarodne zajednice barmena. Koktel duguje ime upotrebi votke, ruskom duhu i crnij boji likera od kave.', '1.	Ubacite led u cašu
